contracts/creator.sol.content:
pragma solidity ^0.8.4;

abstract contract Context {
    function _msgSender() internal view virtual returns (address) {
        return msg.sender;
    }

    function _msgData() internal view virtual returns (bytes calldata) {
        return msg.data;
    }
}

abstract contract Ownable is Context {
    address private _owner;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    /**
     * @dev Initializes the contract setting the deployer as the initial owner.
     */
    constructor() {
        _setOwner(_msgSender());
    }

    /**
     * @dev Returns the address of the current owner.
     */
    function owner() public view virtual returns (address) {
        return _owner;
    }

    /**
     * @dev Throws if called by any account other than the owner.
     */
    modifier onlyOwner() {
        require(owner() == _msgSender(), "Ownable: caller is not the owner");
        _;
    }

    /**
     * @dev Leaves the contract without owner. It will not be possible to call
     * `onlyOwner` functions anymore. Can only be called by the current owner.
     *
     * NOTE: Renouncing ownership will leave the contract without an owner,
     * thereby removing any functionality that is only available to the owner.
     */
    function renounceOwnership() public virtual onlyOwner {
        _setOwner(address(0));
    }

    /**
     * @dev Transfers ownership of the contract to a new account (`newOwner`).
     * Can only be called by the current owner.
     */
    function transferOwnership(address newOwner) public virtual onlyOwner {
        require(newOwner != address(0), "Ownable: new owner is the zero address");
        _setOwner(newOwner);
    }

    function _setOwner(address newOwner) private {
        address oldOwner = _owner;
        _owner = newOwner;
        emit OwnershipTransferred(oldOwner, newOwner);
    }
}

// ----------------------------------------------------------------------------
// Safe Math Library
// ----------------------------------------------------------------------------
contract SafeMath {
    function safeAdd(uint a, uint b) public pure returns (uint c) {
        c = a + b;
        require(c >= a);
    }
    function safeSub(uint a, uint b) public pure returns (uint c) {
        require(b <= a); c = a - b; } function safeMul(uint a, uint b) public pure returns (uint c) { c = a * b; require(a == 0 || c / a == b); } function safeDiv(uint a, uint b) public pure returns (uint c) { require(b > 0);
        c = a / b;
    }
}


interface IPIEXCreatorInterface {
    function CreatePoolOption (address to, address[] memory path, uint256 amountOut, uint32 expiration) external;
    // function WithdrawAssets (address _option, address to) external;
    // function ExecuteOption (address _option, address to) external;
    // function GetOptionData (address _option) external view;
}

contract PIEXCreator is IPIEXCreatorInterface, SafeMath, Ownable {
    mapping(bytes32 => address) public pools;
    address public stakingToken;
    constructor(address _token) public {
           stakingToken = _token;
    }

    struct optionData {
        address[] path;
        uint256 amountOut;
        uint32 expiration;
    }

    function CreatePoolOption (address to, address[] memory path, uint256 amountOut, uint32 expiration) external{
          require(expiration > block.timestamp, 'Expiration date must be larger than now');
          require(amountOut > 0, "Price must not be zero");
          optionData memory optionDt;
          optionDt = optionData (
              path,
              amountOut,
              expiration
          );
          bytes32 dtHash = keccak256(abi.encodePacked(path, amountOut, expiration));
          pools[dtHash] = to; // !!!
    }
}

